package practice_Loop_Question;

public class PrintTable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i =1; i<=5; i++) {
			
			System.out.println();
			System.out.print("Table of " + i );
			
			for(int j =1; j<=10; j++) {
			
				
				System.out.print( " "+(i*j));
				
				
				
			}
		}

	}

}
